<!DOCTYPE html>
<html>

<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=0" />
  <meta http-equiv="X-UA-Compatible" content="ie=edge" />
  <link rel="stylesheet" href="./static/cloudconsole.css" type="text/css" />
  <link rel="stylesheet" href="./internal-static/style.css" type="text/css" />
  <title>Console</title>
</head>

<body>

  <div class="--frame" id="--frame-no-env">
    <i class="ui-icon-spinner --frame-spinner"></i>
    <p class="--init-text --init-lazy-area --secondary-text-color"></p>
  </div>

  <div class="--frame --opacity-0" id="--frame-has-env">
    <div>
      <div>
        <div class="header">
          <div class="toolbar">
            <div class="toolbar-items">
              <div class="toolbar-item">
                <div class="toolbar-action toolbar-action-active">
                  <div class="toolbar-button"></div>
                  <p class="toolbar-label">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
                </div>
              </div>
              <div class="toolbar-item-divider"></div>
              <div class="toolbar-item">
                <div class="toolbar-action">
                  <div class="toolbar-button"></div>
                  <p class="toolbar-label">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
                </div>
              </div>
              <div class="toolbar-item">
                <div class="toolbar-action">
                  <div class="toolbar-button"></div>
                  <p class="toolbar-label">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
                </div>
              </div>
              <div class="toolbar-item">
                <div class="toolbar-action">
                  <div class="toolbar-button"></div>
                  <p class="toolbar-label">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
                </div>
              </div>
              <div class="toolbar-item-divider"></div>
              <div class="toolbar-item">
                <div class="toolbar-action">
                  <div class="toolbar-button"></div>
                  <p class="toolbar-label">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="main">
          <div class="sidebar">
            <ul class="sidebar-list">
              <li class="sidebar-item sidebar-item_current" style="width: 100%">&nbsp;</li>
            </ul>
          </div>
          <div class="content">
            <div class="wrap">
              <div class="analysis">
                <div class="refresh">
                  <button class="ui-button ui-button-default ">
                    <i class="ui-icon-refresh mr-5 --opacity-0"></i>&nbsp;&nbsp;&nbsp;&nbsp;
                  </button>
                </div>
                <div class="panel analysis-usage">
                  <div className="analysis-usage-main">
                    <!-- <div class="analysis-usage-item" style="padding: 0">
                      <div class="analysis-usage-label">&nbsp;</div>
                      <div class="analysis-usage-statistics --font-weight-600">&nbsp;</div>
                    </div> -->
                    <div class="--init-lazy-area" style="flex: 1;">
                      <i class="ui-icon-spinner --frame-spinner" style="margin: 0 auto;"></i>
                      <p class="--init-text --secondary-text-color"></p>
                    </div>
                  </div>
                </div>
                <div class="analysis-content">
                  <div class="panel">
                    <div class="analysis-chart-block">
                      <div class="analysis-chart-item">
                        <div class="panel-hd">&nbsp;</div>
                        <div class="panel-bd">
                          <div class="chart-content">
                            <div class="chart-nodata">&nbsp;</div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="footer"></div>
      </div>
    </div>
  </div>

  <div id="react-root" class="container"></div>
  <script src="./js/bundle.js" defer></script>
</body>

</html>
